import React from 'react'
import { Component } from 'react';
import "./Hello.css"


class Hello extends Component {
    render() {
        return (
            <div>
                <h1> Hello World </h1>
                <p>Welcomo to react</p>
            </div>
        )
    } 
 } 

export default Hello;
